import React from 'react';
import BoardList from '../components/BoardList';
import { connect } from 'react-redux';

class Board extends React.Component {
  render() {
    const { boards } = this.props;

    return(
      <div>
        <h1>Board</h1>
        <BoardList 
          boards={boards}
        />
      </div>
    );
  }
}

export default connect(
  (state) => ({
    boards: state.boards
  })
)(Board);
